Lei nº.  4-01960

 Publicado em 27 de março de 2014, na sessão nº.  218

 SCILIPOTI - Ao Presidente do Conselho de Ministros e aos Ministros da Saúde, do Ambiente e da Protecção do Território e do Mar e da Defesa.  -
 Dado que:
 em 1999 o Parlamento Europeu com a resolução n.  Em 4-0005/99 de 14 de janeiro de 1999 manifestou-se contra os julgamentos do HAARP (baseado no Alasca-EUA);
 em 2002, a Itália assinou um acordo bilateral com os EUA sobre pesquisa climática e o chefe dos pesquisadores italianos e o professor Franco Prodi;
 em 2003, o Ministro da Defesa pro tempore, Martino, autorizou a Força Aérea dos Estados Unidos (USAF) a sobrevoar o espaço aéreo da Itália;
 as substâncias tóxicas utilizadas para operações de aerossóis são compostas por metais, polímeros, silicatos, vírus e bactérias;
 o alumínio é uma substância neurotóxica que danifica tanto o sistema nervoso central quanto os processos homeostáticos celulares (o alumínio tem um fator determinante no Alzheimer);
 a intoxicação por metais produz uma diminuição das defesas imunológicas;
 o alumínio mata a flora bacteriana do solo;
 as chuvas produzidas pelos chemtrails alteram o pH da terra;
 as operações de aerossóis, comumente chamadas de chemtrails, acabam causando, na opinião do questionador, uma violação dos direitos consagrados na Constituição,
 você pergunta para saber:
 se o Governo pretende empreender, no que lhe diz respeito, iniciativas destinadas a apurar os valores de acidez, ou seja, os valores de pH alterados de 2003 para 2010, mapear com precisão a qualidade atual do terreno e garantir a cessação de tais operações que, consequentemente, obrigam o uso de OGM;
 se pretende promover campanhas de medição do teor de bário e alumínio nas águas pluviais em todo o território nacional, por meio de verificações após as chuvas causadas por operações militares, e do índice de poluição do ar especificamente em relação aos produtos utilizados nas operações aerossóis;
 se pretende promover estudos para determinar o risco ambiental e sanitário da população dos territórios sujeitos a operações permanentes de chemtrail;
 se quer favorecer estudos destinados a esclarecer a influência que as operações de chemtrail de 2003 até hoje tiveram na saúde dos italianos;
 se tenciona tomar medidas para publicar investigação epidemiológica relativa a doenças infecciosas do aparelho respiratório, alergias por intoxicação por metais e Alzheimer e outras doenças degenerativas atribuíveis à intoxicação por metais;
 se pretende promover pesquisas para estimar a correlação do aumento de doenças em relação às substâncias usadas em chemtrails: obviamente toda doença é multifatorial e as questões ambientais têm um impacto significativo, mas tente determinar se houve um aumento desde 2003 provavelmente devido a chemtrails;
 se pretende promover o cancelamento do segredo de Estado relativo aos chemtrails e cessar as operações que os envolvem.
